import React from 'react';
import {
  Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle
} from 'reactstrap';
import 'typeface-rubik'


const CardService = (props) => {
   
  return (

    <div>

<Card className="text-center">
      <Card.Header>{props.details.categoria}</Card.Header>
      <Card.Body>
        <Card.Title>{props.details.nomedavaga}</Card.Title>
        <Card.Text>{props.details.nomedavaga}</Card.Text>
        <Card.Text>{props.details.horas}</Card.Text>
        <button className="button">Participar</button>
      </Card.Body>
      <Card.Footer className="cidade">{props.details.cidade}</Card.Footer>
    </Card>
      
    </div>

  );
};

export default CardService;
